import React from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
} from "react-router-dom";
import { makeStyles } from '@material-ui/core/styles';
import { Button, MenuItem } from "@material-ui/core";
import Toolbar from '@material-ui/core/Toolbar';
import AppBar from '@material-ui/core/AppBar';
import Home from './screens/Home/index';
import ButtonAppBarCollapse from './component/ButtonAppBarCollapse';

const useStyles = makeStyles((theme) => ({
    appBar: {
        backgroundColor: '#FCFCFC',
        color: "black",
        fontWeight: 'bold',
    },
    toolBar: {
        justifyContent: 'center',
    },
    button: {
        marginRight: 30
    },
    buttonBar: {
        [theme.breakpoints.down("xs")]: {
            display: "none"
        },
        margin: "10px",
        paddingLeft: "16px",
        right: 0,
        position: "relative",
        width: "100%",
        background: "transparent"
    }
}));
function App() {
    const classes = useStyles();
  return (
      <div>
          <AppBar position="static" className={classes.appBar}>
              <Toolbar className={classes.toolBar}>
                  <div>
                      <ButtonAppBarCollapse>
                          <MenuItem>Login</MenuItem>
                          <MenuItem>Signup</MenuItem>
                      </ButtonAppBarCollapse>
                      <div className={classes.buttonBar} id="appbar-collapse">
                          <Button color="inherit">Login</Button>
                          <Button color="inherit">Signup</Button>
                      </div>
                  </div>
                  <Button color="inherit" className={classes.button}>Главная</Button>
                  <Button color="inherit" className={classes.button}>Мы</Button>
                  <Button color="inherit" className={classes.button}>Моменты</Button>
                  <Button color="inherit" className={classes.button}>Где когда Как</Button>
                  <Button color="inherit" className={classes.button}>Твои пожелания</Button>
              </Toolbar>
          </AppBar>
          <Router>
              <Switch>
                  <Route path="/" exact component={Home} />
              </Switch>
          </Router>
      </div>
  );
}

export default App;
